  def __printCmdDes (self,command="",description=""):
    if description != "": description = "//"+description
    if self.printOut == True and self.printOutLevel == "Fatal"   : logger.fatal("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Error"   : logger.error("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Warn"    : logger.warn ("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Info"    : logger.info ("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Debug"   : logger.debug("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Trace"   : logger.trace("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "Terminal": print ("%s %s",command,description)
    if self.printOut == True and self.printOutLevel == "NoPrint" : return
    

